  // const { data } = res;
  // return {
  //   props: { ...data }, // will be passed to the page component as props
  // };

  return {
    props: { ...PRODUCT_DATA },
  };
  

}

const ShopPage = (props) => {
  // const firstAlbums = Object.values(props).slice(0,6);
  // console.log(firstAlbums[0]);

  console.log(props);

  return (
    <div className='shop'>
      {props.map((a) => (
        <div className='items'>
          <h2>{a.title}</h2>
          <img src={a.thumbnailUrl} alt={a.title}/>
        </div>
      ))}
    </div>
  );
};

export default ShopPage;
